"""# **Randam Forest Model**"""

#Importing Required library for Random Forest
from sklearn.ensemble import RandomForestRegressor

# Initialize the Random Forest regressor
rf_model = RandomForestRegressor(random_state=42)

#Fitting the model
rf_model.fit(X_train, y_train)

# Make predictions on the test set
y_pred = rf_model.predict(X_test)
print("Predicted Surface Roughness")
print(y_pred)

# Evaluate the model performance
mse = mean_squared_error(y_test, y_pred)
rmse = mse ** 0.5
r2 = r2_score(y_test, y_pred)
print('RANDOM FOREST MODEL: ')
print("Mean Squared Error:", mse)
print("Root mean square Error: ",rmse)
print("R-squared:", r2)

"""# Visualizations"""

from sklearn.feature_selection import SelectKBest, f_regression

# Visualize the predicted vs. actual values
plt.figure(figsize=(8, 6))
plt.scatter(y_test, y_pred)
plt.xlabel('Actual Ra')
plt.ylabel('Predicted Ra')
plt.title('Predicted vs. Actual Ra')
plt.grid(True)
plt.show()

# Residual Analysis
residuals = y_test - y_pred
plt.figure(figsize=(8, 6))
plt.scatter(y_pred, residuals)
plt.axhline(y=0, color='red', linestyle='--')
plt.xlabel('Predicted Tool Wear')
plt.ylabel('Residuals')
plt.title('Residual Analysis')
plt.grid(True)
plt.show()

# Perform feature selection using SelectKBest and f_regression
k = 2  # Number of features to select
selector = SelectKBest(score_func=f_regression, k=k)
X_train_selected = selector.fit_transform(X_train, y_train)
X_test_selected = selector.transform(X_test)

# Get the selected feature indices
selected_feature_indices = selector.get_support(indices=True)
selected_features = X.columns[selected_feature_indices]

# Initialize and train a model using the selected features
model = RandomForestRegressor()
model.fit(X_train_selected, y_train)

# Evaluate the model on the test set using the selected features
y_pred = model.predict(X_test_selected)

# Print the selected features
print("Selected Features:", selected_features.tolist())

